import React from "react";
import donut from "../assets/about_desktop/donut.png";
import instaIcon from "../assets/about_desktop/insta_icon.png";
import phoneIcon from "../assets/about_desktop/phone_icon.png";
import locIcon from "../assets/about_desktop/loc_icon.png";
import emailIcon from "../assets/about_desktop/email.png";

const AboutMobile: React.FC = () => {
  return (
    <div
      style={{
        backgroundColor: "#987384",
        color: "black",
        fontFamily: "'Comic Sans MS', cursive, sans-serif",
        padding: "24px",
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        minHeight: "100vh",
      }}
    >
      {/* Intro */}
      <div style={{ fontSize: "1.1rem", lineHeight: "1.7", textAlign: "center", marginBottom: "24px" }}>
        <p>
          From the Founder of<br />
          <strong>Spread Bagelry</strong><br />
          Comes a ‘Hole’ New Experience in<br />
          Coffee & Donuts
        </p>
        <p style={{ marginTop: "16px" }}>
          Homemade Pancake Donuts & Toppings<br />
          Sweet/Savory<br />
          Great Coffee
        </p>
      </div>

      {/* Donut Image */}
      <img
        src={donut}
        alt="Donut"
        style={{
          width: "80%",
          maxWidth: "300px",
          marginBottom: "24px",
        }}
      />

      {/* Contact Info */}
      <div style={{ width: "100%", marginBottom: "24px", display: "flex", flexDirection: "column", gap: "16px" }}>
        <ContactRow icon={instaIcon} text="@ringocoffeeanddonuts" />
        <ContactRow icon={locIcon} text="2001 Federal St, Philadelphia, PA 19146" />
        <ContactRow icon={phoneIcon} text="(215) 594-2802" />
        <ContactRow icon={emailIcon} text="info@ringocoffee.com" />
      </div>

      {/* Email Form */}
      <div style={{ width: "100%", textAlign: "center", marginBottom: "32px" }}>
        <p style={{ fontSize: "1.1rem", marginBottom: "10px" }}><i>Join our Inner Circle!</i></p>
        <form
          onSubmit={(e) => {
            e.preventDefault();
            const email = (e.target as any).email.value;
            alert(`Submitted: ${email}`);
          }}
          style={{
            display: "flex",
            justifyContent: "center",
            gap: "8px",
            backgroundColor: "#fff",
            borderRadius: "20px",
            padding: "5px 10px",
            width: "100%",
            maxWidth: "350px",
            margin: "0 auto",
          }}
        >
          <input
            type="email"
            name="email"
            placeholder="Email Address"
            required
            style={{
              border: "none",
              outline: "none",
              padding: "8px",
              borderRadius: "20px",
              flex: 1,
              fontSize: "1rem",
            }}
          />
          <button
            type="submit"
            style={{
              backgroundColor: "#bbb",
              border: "none",
              padding: "6px 16px",
              borderRadius: "20px",
              cursor: "pointer",
            }}
          >
            Submit
          </button>
        </form>
      </div>

      {/* Footer */}
      <footer style={{ fontSize: "0.9rem", opacity: 0.7, textAlign: "center" }}>
        © {new Date().getFullYear()} Ringo Coffee & Donuts. All rights reserved.
      </footer>
    </div>
  );
};

const ContactRow = ({ icon, text }: { icon: string; text: string }) => (
  <div style={{ display: "flex", alignItems: "center", gap: "12px" }}>
    <img src={icon} alt="icon" style={{ width: "24px", height: "24px" }} />
    <span style={{ fontSize: "1rem" }}>{text}</span>
  </div>
);

export default AboutMobile;
